#wonderfulweather
Our morning walk ( lake trail ).

Ну , сказать по правде, утром я не была весела и доброжелательна 🙄😅.

Я люблю тихое , размеренное утро ( возраст уже 😅🤐) ... выпить кофе и спокойно позавтракать, просматривая новости 🧐. 
И вот , накормив детей и приготовив завтрак себе, надежда была насладиться пятничным утром ... но не тут то было ... как обычно, младший тут как тут, руками в моей тарелке, старшему нужно начать беситься ... в общем, моё обычное такое утро в последнее время 🤯 ( если не встану раньше детей ) ... 

пережив это волшебное время завтрака 🙄😤🤸‍♂️, всё же настроение улучшилось 🧘‍♀️ ... потому как ... 

погода была  замечательная с утра 👌 , ни ветерка, солнечно ... поэтому мы с малышнёй воспользовались этим и одолели пешеходный маршрут вдоль озера, потом повалялись под деревом в теньке, полазили по нему же ... встретили милого дедушку с милой собакой и мило поболтали 🙃.

Замечательного настроения всем ... даже если оно не очень, обращайте внимание на приятные  мелочи , улыбнитесь и настроение улучшится ♡.
